def find_min(nums):

    left, right = 0, len(nums) - 1
    while left + 1 < right:
        mid = (left + right) // 2
        if nums[mid] < nums[right]:
            right = mid
        else:
            left = mid
    if nums[left] < nums[right]:
        return nums[left]
    else:
        return nums[right]

