def getTime(seconds):
    if seconds == 0:
        return '0 secs.\n'
    elif seconds < 60:
        return str(seconds) + ' secs.\n'
    elif seconds < 3600:
        minutes = seconds // 60
        seconds %= 60
        return str(minutes) + ' mins, ' + str(seconds) + ' secs.\n'
    else:
        hours = seconds // 3600
        seconds %= 3600
        minutes = seconds // 60
        seconds %= 60
        return str(hours) + ' hours, ' + str(minutes) + ' mins, ' + str(seconds) + ' secs.\n'

