def ewm_std(data, halflife_mean=1, halflife_std=10, k = 1): 

    mean = data.ewm(halflife = halflife_mean).mean().shift(1)
    std = data.ewm(halflife = halflife_std).std().shift(1)
    std = std[std>0]
