def sleep_interval(interval, now, wake_up_second):

    next_wakeup = float(now + interval)
    if wake_up_second > interval:
        return next_wakeup - now
    next_wakeup = next_wakeup - (next_wakeup % wake_up_second)
    return next_wakeup - now

