def get_v_job(v_job_type, job_rel, cand_exprank, j):

    if v_job_type == "inv":
        temp = torch.div(job_rel[j,:], cand_exprank[j,:])
    elif v_job_type == "log":
        exa = 1./torch.log(cand_exprank[j,:]+1)
        temp = torch.mul(job_rel[j,:], exa)
    elif v_job_type == "exp":
        temp = torch.div(job_rel[j, :], torch.exp(cand_exprank[j,:]-1))
