def median(lst, presorted=False):

    if not presorted:
        sorted_lst = sorted(lst)
    else:
        sorted_lst = lst
    n = len(lst)
    if n < 1:
        return None
    if n % 2 == 1:
        return sorted_lst[n//2]
    else:
        return sum(sorted_lst[n//2-1:n//2+1])/2.0

