def convert_byte_to( n , from_unit, to , block_size=1024 ):

    table = {'b': 1, 'k': 2 , 'm': 3 , 'g': 4 , 't': 5 , 'p': 6}
    number = float(n)
    change_factor = table[to] - table[from_unit]
    number /= (block_size ** change_factor)
    return number

