def parse_filename(fname):

    if fname.endswith('.ipynb'):
        format = 'json'
    elif fname.endswith('.json'):
        format = 'json'
    elif fname.endswith('.py'):
        format = 'py'
    else:
        fname = fname + '.ipynb'
        format = 'json'
    name = fname.split('.')[0]
    return fname, name, format

